遂にIII型HID用のインナーブラックのヘッドライトが登場！<br><br>
Ｉ型、II型ハイエースをIII型HIDルックに取り付け可能。<br>
III型ヘッドライト車にも対応(※)しています。<br>
純正のヘッドライトからLow/Hiビーム・バラスト・<br>
ポジションバルブウィンカーバルブレベライザーを<br>
移植するだけで、車両への加工は一切不要！！<br><br>
※III型ヘッドライトに装着する場合は、別売オプション<br>
ブラケット5,250円が必要になります。
<hr>
【適合車名】ハイエース/レジアスハイエース 200系III型<br>
【適合年式】2010年7月<br>
【メーカー】CRS/シーアールエス<hr>
【カラー】<br>
ステルスブラック(艶消し)<br>
クロームブラック(艶有り)<br>
クローム<br>
※この記事はクロームブラックです

<hr>
●1年間水漏れ保証付<br>
●オートレベライザー対応<br>
(純正移植可能です)<br>

<hr>
<font color="#ff0000"><b>【必ずお読みください】</b></font><br>
※『1万円以上送料無料』対象外商品です。<br>
※別商品との同梱はできません。<br>
※メーカーからの直送商品です。<br>
※代引きはお受けすることが出来ません。<br>
※お急ぎの方はご注文前に納期お問い合わせ下さい。<br>
※北海道・沖縄・離島の場合は送料着払いにてご対応させて頂きます。<br>







